#pragma function(memcpy)
extern "C" void *__cdecl memcpy(void *dst, const void *src, size_t count)
{
	void *ret = dst;
	while (count--) {
		*(char *) dst = *(char *) src;
		dst = (char *) dst + 1;
		src = (char *) src + 1;
	}
	return (ret);
}

#pragma function(memset)
extern "C" void *__cdecl memset(void *dest, int value, size_t size)
{
	BYTE *lpDest = (BYTE *) dest;
	if (lpDest)
		for (SIZE_T i = 0; i < size; ++i) {
			*(lpDest++) = (BYTE) value;
		}
	return lpDest;
}

#pragma function(memcmp)
extern "C" int __cdecl memcmp(const void *s1, const void *s2, size_t len)
{
	if (s1 != NULL && s2 != NULL)
		for (unsigned long j = 0; j < len; j++)
			if (((char *) s1)[j] != ((char *) s2)[j]) {
				return (((char *) s1)[j] > ((char *) s2)[j]) ? 1 : -1;
			}

	return 0;
}

//#pragma function(memmove)
extern "C" void *__cdecl memmove(void *dest, const void *src, size_t n)
{
	unsigned char *pd = (unsigned char *) dest;
	const unsigned char *ps = (unsigned char *) src;
	if (ps < pd)
		for (pd += n, ps += n; n--;) {
			*--pd = *--ps;
		} else
		while (n--) {
			*pd++ = *ps++;
		}
	return dest;
}

